import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet } from 'react-native';
import Background from '../components/Background';
import Logo from '../components/Logo';
import Header from '../components/Header';
import Button from '../components/Button';
import TextInput from '../components/TextInput';
import { emailValidator } from '../helpers/emailValidator';
import { passwordValidator } from '../helpers/passwordValidator';
import Icon from 'react-native-vector-icons/FontAwesome';
import MaterialIcon from 'react-native-vector-icons/MaterialCommunityIcons';

export default function StartScreen({ navigation }) {
  const [email, setEmail] = useState({ value: '', error: '' });
  const [password, setPassword] = useState({ value: '', error: '' });
  const [isEmailValid, setIsEmailValid] = useState(false);

  useEffect(() => {
    setIsEmailValid(!emailValidator(email.value));
  }, [email.value]);

  const onLoginPressed = () => {
    const emailError = emailValidator(email.value);
    const passwordError = passwordValidator(password.value);
    if (emailError || passwordError) {
      setEmail({ ...email, error: emailError });
      setPassword({ ...password, error: passwordError });
      return;
    }
    navigation.reset({
      index: 0,
      routes: [{ name: 'Dashboard' }],
    });
  };

  const CustomButton = ({ icon, text, onPress, style }) => (
    <Button
      mode="contained"
      onPress={onPress}
      style={[styles.buttonBorder, style]}
    >
      <View style={styles.buttonContent}>
        {icon}
        <Text style={styles.buttonText}>{text}</Text>
      </View>
    </Button>
  );

  return (
    <Background>
      <Header>Sign up or Sign in</Header>

      <TextInput
        title="Email"
        label="Enter your email"
        returnKeyType="next"
        value={email.value}
        onChangeText={(text) => setEmail({ value: text, error: '' })}
        error={!!email.error}
        errorText={email.error}
        autoCapitalize="none"
        autoCompleteType="email"
        textContentType="emailAddress"
        keyboardType="email-address"
      />

      <Button
        color={isEmailValid ? "black" : "gray"}
        mode="contained"
        disabled={!isEmailValid}
        onPress={() => navigation.navigate('EmailSignUp')}
      >
        Continue
      </Button>

      <View style={styles.separatorContainer}>
        <View style={styles.line} />
        <Text style={styles.orText}>or</Text>
        <View style={styles.line} />
      </View>

      <CustomButton
        icon={<Icon name="google" size={20} color="black" />}
        text="Continue with Google"
        onPress={() => navigation.navigate('EmailSignUp')}
        style={styles.buttonBorder}
      />

      <CustomButton
        icon={<Icon name="facebook" size={20} color="black" />}
        text="Continue with Facebook"
        onPress={() => navigation.navigate('EmailSignUp')}
        style={styles.buttonBorder}
      />

      <CustomButton
        icon={<MaterialIcon name="apple" size={20} color="black" />}
        text="Continue with Apple"
        onPress={() => navigation.navigate('EmailSignUp')}
        style={styles.buttonBorder}
      />

    </Background>
  );
}

const styles = StyleSheet.create({
  separatorContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginVertical: 20,
    width: '100%',
  },
  line: {
    flex: 1,
    height: 1,
    backgroundColor: 'black',
  },
  orText: {
    marginHorizontal: 10,
    color: 'gray',
  },
  buttonBorder: {
    borderColor: 'black',
    borderWidth: 1,
    borderRadius: 8,
    justifyContent: 'flex-start',
  },
  buttonContent: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  buttonText: {
    marginLeft: 10,
    color: 'black', // Adjust color if needed
  },
});
